import React from 'react'
import Toolbar from './components/Toolbar'
import UserLoginForm from './components/UserLoginForm'

function Login() {
    return(
        <>
            <Toolbar />
            <div>
                <h1>Sign In</h1>
                <UserLoginForm />
            </div>
        </>
    )
}

export default Login;
